import React from 'react';
import './App.css';
import Countdown from './components/Countdown';

const events = require("./countdown-list.json");

function App() {
  let ret = events.map(event => 
    console.log(event));
    if (event == null ) {
      return (
        <h1>Make a new event!</h1>
      );
    } else {
      return (
        <div className="App">
          <h1>Hello World</h1>
          {events.map(event =>
            <Countdown
              key={event.id}
              title={event.title}
              month={event.month}
              day={event.day}
              year={event.year}
            />
          )}
        </div>
      );
    }

}

export default App;
